class Solution {
    public int strStr(String haystack, String needle) {
        if (needle.isEmpty()) {
            return 0;
        }
        if (haystack.isEmpty()) {
            return -1;
        }
        if (needle.length() > haystack.length()) {
            return -1;
        }
        int[] prefix = computePrefix(needle);
        int q = -1;
        for (int i=0; i<haystack.length(); i++) {
            while (q>=0 && needle.charAt(q+1) != haystack.charAt(i)) {
                q = prefix[q];
            }
            if (needle.charAt(q+1) == haystack.charAt(i)) {
                q = q+1;
            }
            if (q == needle.length()-1) {
                return i-needle.length()+1;
            }
        }
        return -1;
    }

    public int[] computePrefix(String needle) {
        int[] result = new int[needle.length()];
        result[0] = -1;
        int k = -1;
        for (int i=1; i<needle.length(); i++) {
            while (k>=0 && needle.charAt(k+1) != needle.charAt(i)) {
                k = result[k];
            }
            if (needle.charAt(k+1) == needle.charAt(i)) {
                k = k+1;
            }
            result[i] = k;
        }
        return result;
    }
    public int strStr1(String haystack, String needle) {
        if (needle.isEmpty()) {
            return 0;
        }
        if (haystack.isEmpty()) {
            return -1;
        }
        if (needle.length() > haystack.length()) {
            return -1;
        }
        int find = -1;
        for (int i=0; i<=haystack.length()-needle.length(); i++) {
            int j=0;
            for (; j<needle.length(); j++) {
                if (needle.charAt(j) != haystack.charAt(i+j)) {
                    break;
                }
            }
            if (j == needle.length()) {
                find = i;
                break;
            }
        }
        return find;
    }
}
